-- ----------------------------
-- Procedure structure for `del_data`
-- ----------------------------
DROP PROCEDURE IF EXISTS `del_data`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `del_data`()
BEGIN
    DELETE FROM error_log_info WHERE create_date < DATE_SUB(CURDATE(),INTERVAL 3 MONTH);
END
;;
DELIMITER ;

